var rolService={add:function(e,t){try{connector.post(url.rol.add,e,function(e){null!=e?(successMessage({title:message.rol.add.title,content:message.rol.add.success}),t(e)):errorMessage({title:message.rol.add.title,content:message.rol.add.error})})}catch(e){console.log(e)}},update:function(e,t){try{connector.post(url.rol.update,e,function(e){null!=e&&1===e?(successMessage({title:message.rol.update.title,content:message.rol.update.success}),t(e)):errorMessage({title:message.rol.update.title,content:message.rol.update.error})})}catch(e){console.log(e)}},remove:function(e,t){try{connector.post(url.rol.delete,e,function(e){null!=e&&1===e?(successMessage({title:message.rol.delete.title,content:message.rol.delete.success}),t(e)):errorMessage({title:message.rol.delete.title,content:message.rol.delete.error})})}catch(e){console.log(e)}},list:function(t){try{connector.post(url.rol.list,JSON.stringify({id:1}),function(e){null!=e&&0<e.length?t(e):infoMessage({title:message.rol.list.title,content:message.rol.list.empty})})}catch(e){console.log(e)}}};